Once downloaded I compressed the installer exe using the best 7zip compression possible, and also did the same for a java for dummies ebook I torrented :P

I know some people won't have 7zip so I also included it with this torrent, for ease of use.

Virus free, 7zip and netbeans downloaded from the official site and no viruses reported. Java book was downloaded by me from a torrent, McAfee reports nothing bad after a scan and no problems with my computer since I got it.

